{"cells":[{"source":"<a href=\"https://www.kaggle.com/samuelauditama/google-da-cert-capstone-cyclistic?scriptVersionId=88443322\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"edebdd6c","metadata":{"papermill":{"duration":0.121956,"end_time":"2022-02-22T05:48:15.567418","exception":false,"start_time":"2022-02-22T05:48:15.445462","status":"completed"},"tags":[]},"source":["# Google Data Analyst Capstone Project: Cyclistic Scenario\n","\"You are a junior data analyst working in the marketing analyst team at Cyclistic, a bike-share company in Chicago. The director of marketing believes the company’s future success depends on maximizing the number of annual memberships. Therefore, your team wants to understand how casual riders and annual members use Cyclistic bikes differently. From these insights, your team will design a new marketing strategy to convert casual riders into annual members. But first, Cyclistic executives must approve your recommendations, so they must be backed up with compelling data insights and professional data visualizations.\"\n","\n","## About the company\n","In 2016, Cyclistic launched a successful bike-share offering. Since then, the program has grown to a fleet of 5,824 bicycles that are geotracked and locked into a network of 692 stations across Chicago. The bikes can be unlocked from one station and returned to any other station in the system anytime.\n","\n","Until now, Cyclistic’s marketing strategy relied on building general awareness and appealing to broad consumer segments. One approach that helped make these things possible was the flexibility of its pricing plans: single-ride passes, full-day passes, and annual memberships. Customers who purchase single-ride or full-day passes are referred to as casual riders. Customers who purchase annual memberships are Cyclistic members.\n","\n","Cyclistic’s finance analysts have concluded that annual members are much more profitable than casual riders. Although the pricing flexibility helps Cyclistic attract more customers, Moreno believes that maximizing the number of annual members will be key to future growth. Rather than creating a marketing campaign that targets all-new customers, Moreno believes there is a very good chance to convert casual riders into members. She notes that casual riders are already aware of the Cyclistic program and have chosen Cyclistic for their mobility needs.\n","\n","Moreno has set a clear goal: Design marketing strategies aimed at converting casual riders into annual members. In order to do that, however, the marketing analyst team needs to better understand how annual members and casual riders differ, why casual riders would buy a membership, and how digital media could affect their marketing tactics. Moreno and her team are interested in analyzing the Cyclistic historical bike trip data to identify trends.\n","\n","## Stakeholders\n","* **Lily Moreno**: The director of marketing and your manager. Moreno is responsible for the development of campaigns and initiatives to promote the bike-share program. These may include email, social media, and other channels.\n","* **Cyclistic marketing analytics team**: A team of data analysts who are responsible for collecting, analyzing, and reporting data that helps guide Cyclistic marketing strategy. You joined this team six months ago and have been busy learning about Cyclistic’s mission and business goals — as well as how you, as a junior data analyst, can help Cyclistic achieve them.\n","* **Cyclistic executive team**: The notoriously detail-oriented executive team will decide whether to approve the recommended marketing program.\n","\n","## Business Task\n","\n","### Three questions will guide the future marketing program:\n","1. How do annual members and casual riders use Cyclistic bikes differently?\n","2. Why would casual riders buy Cyclistic annual memberships?\n","3. How can Cyclistic use digital media to influence casual riders to become members?\n","\n","### Moreno has assigned you the first question to answer: \n","> **How do annual members and casual riders use Cyclistic bikes differently?**"]},{"cell_type":"markdown","id":"3c8fb17d","metadata":{"papermill":{"duration":0.123297,"end_time":"2022-02-22T05:48:15.808409","exception":false,"start_time":"2022-02-22T05:48:15.685112","status":"completed"},"tags":[]},"source":["# Introduction\n","Hello, my name is Samuel Christofan Auditama, and today we will be looking a fictional company from Google DA Cert Capstone project, *Cyclistic*. If you are keen with detail, you might notice that there are some discrepancies between the project brief and the actual data, since this course was made in 2020 and im currently doing it in 2021-2022. But worry not, we can still work with the provided data and answer the business task: **How do annual members and casual riders use Cyclistic bikes differently?**\n","\n","### Structure\n","This report will follow the recommended structure of:\n","+ **Ask**: What is the business problem to solve\n","+ **Prepare**: Gather relevant data.\n","+ **Process**: Clean and process gathered data.\n","+ **Analyze**: Analyze said data, consult with subject matter expert, explore and/or model data.\n","+ **Share**: Present the insight derived from the analysis with stakeholder, discuss best course of action to solve business problem.\n","+ **Act**: Act upon agreed course of action, or if need be, pursue further insight regarding the business problem with the basis of newly gain insight.\n","\n","Since this capstone case study has provided us with business task and data, we can skip Ask & Perpare phase and jump right into Process, Analyze, and Share. Obviously since this is a case study, we will no be doing the Act phase.\n","\n","First, we will load the libraries needed:\n","Tidyverse, dplyr, readr, and lubridate to manage the data.\n","geosphere to calculate geographic coordinates and geodetic distance.\n","gridextra to help manage our charts.\n"]},{"cell_type":"code","execution_count":1,"id":"5ba062a7","metadata":{"execution":{"iopub.execute_input":"2022-02-22T05:48:16.050667Z","iopub.status.busy":"2022-02-22T05:48:16.04729Z","iopub.status.idle":"2022-02-22T05:48:17.758123Z","shell.execute_reply":"2022-02-22T05:48:17.75607Z"},"papermill":{"duration":1.831746,"end_time":"2022-02-22T05:48:17.758322","exception":false,"start_time":"2022-02-22T05:48:15.926576","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n","\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.5     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.5     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.7\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.1.4     \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.0.2     \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.1\n","\n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\n","\n","Attaching package: ‘lubridate’\n","\n","\n","The following objects are masked from ‘package:base’:\n","\n","    date, intersect, setdiff, union\n","\n","\n","\n","Attaching package: ‘gridExtra’\n","\n","\n","The following object is masked from ‘package:dplyr’:\n","\n","    combine\n","\n","\n"]}],"source":["library(tidyverse)\n","library(dplyr)\n","library(readr)\n","library(lubridate)\n","library(geosphere)\n","library(gridExtra)"]},{"cell_type":"markdown","id":"0d6e46c2","metadata":{"papermill":{"duration":0.127704,"end_time":"2022-02-22T05:48:18.01879","exception":false,"start_time":"2022-02-22T05:48:17.891086","status":"completed"},"tags":[]},"source":["# Data Source\n","Data for this case study is provided by **Motivate International Inc.** From **Lyft Bikes and Scooters, LLC (“Bikeshare”) Divvy bicycle sharing service.** A bikesharing service located in metropolitan area of Chicago, Illinois, U.S.A., owned by Chicago Department of Transportation and Operated by Lyft.\n","\n","Source of data: https://divvy-tripdata.s3.amazonaws.com/index.html\n","\n","Uploaded to Kaggle by: https://www.kaggle.com/samuelmaduka at: https://www.kaggle.com/samuelmaduka/cyclistic-project\n","\n","Data is provided under the following license: https://ride.divvybikes.com/data-license-agreement \n","\n","Data are packed in zip files and comes in CSV format when extracted. Website index contains data dating from 2013 to 2021, but ones that are being used for this analysis is in the range of January 2021 up to December 2021.\n","Each zip files and the subsequent csv within it pertains to 1 month worth of customer activity logged by the system.\n","There 13 columns:\n","+\tride_id: string of character with length of 16 **(character)**\n","+ \trideable_type: types of bike used, 3 types: electric_bike, classic_bike, docked_bike **(character)**\n","+\tstarted_at: Timestamp showing when users start using the bike **(character)**\n","+\tended_at: Timestamp showing when users gets off the bike **(character)**\n","+\tstart_station_name: Name of station the user starts route **(character)**\n","+ \tstart_station_id: Code of station the user starts route **(int)**\n","+\tend_station_name: Name of station the user ends route **(character)**\n","+\tend_station_id: Code of station the user ends route **(int)**\n","+\tstart_lat: Geolocation latitude of starting station **(int)**\n","+ \tstart_lng: Geolocation longitude of starting station **(int)**\n","+ \tend_lat: Geolocation latitude of ending station **(int)**\n","+ \tend_lng: Geolocation longitude of ending station **(int)**\n","+ \tmember_casual: Type of user membership using the current bike, member or casual **(character)**\n"]},{"cell_type":"markdown","id":"71defc0f","metadata":{"papermill":{"duration":0.12923,"end_time":"2022-02-22T05:48:18.272181","exception":false,"start_time":"2022-02-22T05:48:18.142951","status":"completed"},"tags":[]},"source":["### Reading the Data\n","We will read the data using a for loop, since typing each of their address is time consuming.\n","Each for loop will take in the number of loops as an input to place into the month \"mnths\" placeholder, thus it will allocate variable dynamically using the assign() function."]},{"cell_type":"code","execution_count":2,"id":"e41e2c31","metadata":{"execution":{"iopub.execute_input":"2022-02-22T05:48:18.587266Z","iopub.status.busy":"2022-02-22T05:48:18.538081Z","iopub.status.idle":"2022-02-22T05:51:15.914416Z","shell.execute_reply":"2022-02-22T05:51:15.913441Z"},"papermill":{"duration":177.51456,"end_time":"2022-02-22T05:51:15.914631","exception":false,"start_time":"2022-02-22T05:48:18.400071","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Warning message in scan(file = file, what = what, sep = sep, quote = quote, dec = dec, :\n","“embedded nul(s) found in input”\n"]},{"name":"stdout","output_type":"stream","text":["Rows: 5,390,984\n","Columns: 13\n","$ ride_id            \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m \"E19E6F1B8D4C42ED\", \"DC88F20C2C55F27F\", \"EC45C94683…\n","$ rideable_type      \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m \"electric_bike\", \"electric_bike\", \"electric_bike\", …\n","$ started_at         \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m \"2021-01-23 16:14:19\", \"2021-01-27 18:43:08\", \"2021…\n","$ ended_at           \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m \"2021-01-23 16:24:44\", \"2021-01-27 18:47:12\", \"2021…\n","$ start_station_name \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m \"California Ave & Cortez St\", \"California Ave & Cor…\n","$ start_station_id   \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m \"17660\", \"17660\", \"17660\", \"17660\", \"17660\", \"17660…\n","$ end_station_name   \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m \"\", \"\", \"\", \"\", \"\", \"\", \"\", \"\", \"\", \"Wood St & Augu…\n","$ end_station_id     \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m \"\", \"\", \"\", \"\", \"\", \"\", \"\", \"\", \"\", \"657\", \"13258\",…\n","$ start_lat          \u001b[3m\u001b[90m<dbl>\u001b[39m\u001b[23m 41.90034, 41.90033, 41.90031, 41.90040, 41.90033, 4…\n","$ start_lng          \u001b[3m\u001b[90m<dbl>\u001b[39m\u001b[23m -87.69674, -87.69671, -87.69664, -87.69666, -87.696…\n","$ end_lat            \u001b[3m\u001b[90m<dbl>\u001b[39m\u001b[23m 41.89000, 41.90000, 41.90000, 41.92000, 41.90000, 4…\n","$ end_lng            \u001b[3m\u001b[90m<dbl>\u001b[39m\u001b[23m -87.72000, -87.69000, -87.70000, -87.69000, -87.700…\n","$ member_casual      \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m \"member\", \"member\", \"member\", \"member\", \"casual\", \"…\n"]},{"data":{"text/plain":["   ride_id          rideable_type       started_at          ended_at        \n"," Length:5390984     Length:5390984     Length:5390984     Length:5390984    \n"," Class :character   Class :character   Class :character   Class :character  \n"," Mode  :character   Mode  :character   Mode  :character   Mode  :character  \n","                                                                            \n","                                                                            \n","                                                                            \n","                                                                            \n"," start_station_name start_station_id   end_station_name   end_station_id    \n"," Length:5390984     Length:5390984     Length:5390984     Length:5390984    \n"," Class :character   Class :character   Class :character   Class :character  \n"," Mode  :character   Mode  :character   Mode  :character   Mode  :character  \n","                                                                            \n","                                                                            \n","                                                                            \n","                                                                            \n","   start_lat       start_lng         end_lat         end_lng      \n"," Min.   :41.64   Min.   :-87.84   Min.   :41.39   Min.   :-88.97  \n"," 1st Qu.:41.88   1st Qu.:-87.66   1st Qu.:41.88   1st Qu.:-87.66  \n"," Median :41.90   Median :-87.64   Median :41.90   Median :-87.64  \n"," Mean   :41.90   Mean   :-87.65   Mean   :41.90   Mean   :-87.65  \n"," 3rd Qu.:41.93   3rd Qu.:-87.63   3rd Qu.:41.93   3rd Qu.:-87.63  \n"," Max.   :42.07   Max.   :-87.52   Max.   :42.17   Max.   :-87.49  \n"," NA's   :1       NA's   :1        NA's   :4673    NA's   :4673    \n"," member_casual     \n"," Length:5390984    \n"," Class :character  \n"," Mode  :character  \n","                   \n","                   \n","                   \n","                   "]},"metadata":{},"output_type":"display_data"}],"source":["k <- 0\n","# This loop iterates from 1 to 12 (no. of months) as an index to load the data and \n","# combine it instead of seperate monthly data.\n","for (z in 1:12) {\n","    \n","    # If under 10, concatenate \"0\", eg. January = \"1\", so \"01\"\n","    # else assigned it to the variable as is.\n","    if (z < 10) {\n","        mnths <- paste0(\"0\", as.character(z))\n","    } else {\n","        mnths <- as.character(z)\n","    }\n","    \n","    # Concatenate the string to form file path dynamically and assign it to a variable to be read below.\n","    datapath <- paste0(\"../input/cyclistic-project/2021\", mnths, \"-divvy-tripdata.csv\")\n","    \n","    # If first loop (k == 0), then make a a variable df_bike, and assig the first month to it.\n","    if (k == 0) {\n","        k <- 1\n","        assign(\"df_bike\", assign(paste0(\"bike\", as.character(mnths)), read.csv((file = datapath))))\n","        } else {\n","    # If not first loop, then continue to add rows of subsequent months to df_bike\n","            df_bike <- rbind(df_bike, assign(paste0(\"bike\", as.character(mnths)), read.csv((file = datapath))))\n","        }\n","    \n","    rm(list = paste0(\"bike\", as.character(mnths)))\n","    \n","}\n","rm(list = c(\"mnths\", \"k\", \"z\", \"datapath\"))\n","glimpse(df_bike)\n","summary(df_bike)"]},{"cell_type":"markdown","id":"5b08f419","metadata":{"papermill":{"duration":0.128451,"end_time":"2022-02-22T05:51:16.182716","exception":false,"start_time":"2022-02-22T05:51:16.054265","status":"completed"},"tags":[]},"source":["# Data Cleaning & Processing\n","After reading the data and looking at the summary, we will now proceed to clean and organize the data.\n","\n","1. Every \"NA\" entry will be removed using na.omit() - note that you may see some of the start/end station name and id has a blank entry. After a quick check with the original data from Lyft and , those with the blank entry are from rideable_type \"classic_bike\" and \"electric_bike\" which has a lock mechanism, allowing customer to check-out and dock the bike anywhere, regardless of bike station availability, unlike \"docked_bike\" which requires customer to dock the bike at a docking station.\n","A quick verification can be done with the following code later:\n","\n","* head(subset(bikedata, rideable_type == \"docked_bike\" & start_station_name == \"\"))\n","* head(subset(bikedata, rideable_type == \"docked_bike\" & end_station_name == \"\"))\n","\n","2. A few correction to date & time for started_at and ended_at variable, assigning it to the America/Chicago timezone CST.\n","3. Changing data type of member_casual & rideable_type variable from character/string to factor.\n","4. Making new columns: \n","+ dayofweek - which day the customer initiates the ride.\n","+ month - what month the customer initiates the ride.\n","+ traveltime_SECS - time difference in seconds of started_at and ended_at\n","+ traveldist_METER - distance in meter from the start & end point. Compares starting lattitude & longitude (start_lat & start_lng) to ending lattitude & longitude (end_lat & end_lng).\n"]},{"cell_type":"code","execution_count":3,"id":"c99a7c7a","metadata":{"execution":{"iopub.execute_input":"2022-02-22T05:51:16.453569Z","iopub.status.busy":"2022-02-22T05:51:16.451739Z","iopub.status.idle":"2022-02-22T05:52:11.403601Z","shell.execute_reply":"2022-02-22T05:52:11.404154Z"},"papermill":{"duration":55.088967,"end_time":"2022-02-22T05:52:11.40433","exception":false,"start_time":"2022-02-22T05:51:16.315363","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["   ride_id                rideable_type       started_at                 \n"," Length:5386311     classic_bike :3139177   Min.   :2021-01-01 00:02:05  \n"," Class :character   docked_bike  : 296154   1st Qu.:2021-06-12 22:39:19  \n"," Mode  :character   electric_bike:1950980   Median :2021-08-05 05:41:55  \n","                                            Mean   :2021-08-01 01:54:56  \n","                                            3rd Qu.:2021-09-26 12:55:29  \n","                                            Max.   :2021-12-31 23:59:48  \n","                                                                         \n","    ended_at                   start_station_name start_station_id  \n"," Min.   :2021-01-01 00:08:39   Length:5386311     Length:5386311    \n"," 1st Qu.:2021-06-12 23:06:19   Class :character   Class :character  \n"," Median :2021-08-05 06:00:07   Mode  :character   Mode  :character  \n"," Mean   :2021-08-01 02:15:46                                        \n"," 3rd Qu.:2021-09-26 13:19:20                                        \n"," Max.   :2022-01-03 17:32:18                                        \n","                                                                    \n"," end_station_name   end_station_id       start_lat       start_lng     \n"," Length:5386311     Length:5386311     Min.   :41.64   Min.   :-87.84  \n"," Class :character   Class :character   1st Qu.:41.88   1st Qu.:-87.66  \n"," Mode  :character   Mode  :character   Median :41.90   Median :-87.64  \n","                                       Mean   :41.90   Mean   :-87.65  \n","                                       3rd Qu.:41.93   3rd Qu.:-87.63  \n","                                       Max.   :42.07   Max.   :-87.52  \n","                                                                       \n","    end_lat         end_lng       member_casual    dayofweek   \n"," Min.   :41.39   Min.   :-88.97   casual:2423119   Mon:673070  \n"," 1st Qu.:41.88   1st Qu.:-87.66   member:2963192   Tue:719778  \n"," Median :41.90   Median :-87.64                    Wed:732044  \n"," Mean   :41.90   Mean   :-87.65                    Thu:714840  \n"," 3rd Qu.:41.93   3rd Qu.:-87.63                    Fri:784222  \n"," Max.   :42.17   Max.   :-87.49                    Sat:946663  \n","                                                   Sun:815694  \n","     month         traveltime_SECS   traveldist_METER  \n"," Jul    : 821679   Min.   :  -3482   Min.   :     0.0  \n"," Aug    : 803646   1st Qu.:    403   1st Qu.:   904.9  \n"," Sep    : 755552   Median :    715   Median :  1640.0  \n"," Jun    : 728878   Mean   :   1250   Mean   :  2190.6  \n"," Oct    : 630742   3rd Qu.:   1296   3rd Qu.:  2885.2  \n"," Nov    : 359787   Max.   :3356649   Max.   :114511.7  \n"," (Other):1286027                                       "]},"metadata":{},"output_type":"display_data"}],"source":["df_bike <- na.omit(df_bike)\n","\n","# Column data type correction\n","df_bike$started_at <- as_datetime(df_bike$started_at, tz = \"America/Chicago\")\n","df_bike$ended_at <- as_datetime(df_bike$ended_at, tz = \"America/Chicago\")\n","df_bike$member_casual <- factor(df_bike$member_casual)\n","df_bike$rideable_type <- factor(df_bike$rideable_type)\n","\n","# Making new variables based on csv native variables.\n","# dayofweek (takes ride start timestamp and extract day of week.)\n","# month (takes ride start timestamp and extract month.)\n","# traveltime_SECS (time difference of ride start and ride end timestamp.)\n","# traveldist_METER (geodetic distance of starting and ending geographic coordinates.)\n","df_bike$dayofweek <- wday(df_bike$started_at, label = TRUE, week_start = 1)\n","df_bike$month <- month(df_bike$started_at, label = TRUE)\n","df_bike$traveltime_SECS <- as.integer(difftime(df_bike$ended_at, df_bike$started_at, units = \"secs\"))\n","df_bike$traveldist_METER <- distHaversine(matrix(c(df_bike$start_lng, df_bike$start_lat), ncol = 2), matrix(c(df_bike$end_lng, df_bike$end_lat), ncol = 2))\n","# traveldist_METER is calculated using Haversine globe sphere, less accurate than distGeo(), but \n","# calculates faster. I decided to use this due to the fact that when customer \n","# aren't docking in a docking station, geodetic coordinates are rounded off and thus less accurate to begin with.\n","\n","# Rounds traveldist_METER to 2 decimal place.\n","df_bike$traveldist_METER <- as.numeric(format((round(df_bike$traveldist_METER, 2))))\n","\n","summary(df_bike)"]},{"cell_type":"markdown","id":"50fe9722","metadata":{"papermill":{"duration":0.131167,"end_time":"2022-02-22T05:52:11.66218","exception":false,"start_time":"2022-02-22T05:52:11.531013","status":"completed"},"tags":[]},"source":["The following code chunk proves that there is no docked bike that starts and ends on location without a station."]},{"cell_type":"code","execution_count":4,"id":"654a1613","metadata":{"execution":{"iopub.execute_input":"2022-02-22T05:52:11.927055Z","iopub.status