atus":"completed"},"tags":[]},"source":["While exploring the data with the new travel time and distance variable, negative values and positive values with unrealistic distance & time were found.\n","Further cleaning will be made by only including data that are within a minimum travel time of 5 minutes (300 seconds) & 100m distance, and a maximum travel time of 8h (28800 seconds) & 15km. \n","\n","Maximum limit might still sound somewhat ridiculous that someone would cycle for 15km and 8 hours straight, but we should mind that the original data includes the following pricing plan:\n","Member (charged annually), day pass, and single trip. Day pass makes sense if a customer (potentially tourist visiting Chicago) would rent the bike for 8h before checking out."]},{"cell_type":"code","execution_count":5,"id":"98fd1792","metadata":{"execution":{"iopub.execute_input":"2022-02-22T05:52:13.431249Z","iopub.status.busy":"2022-02-22T05:52:13.429368Z","iopub.status.idle":"2022-02-22T05:52:16.75595Z","shell.execute_reply":"2022-02-22T05:52:16.754376Z"},"papermill":{"duration":3.465953,"end_time":"2022-02-22T05:52:16.756115","exception":false,"start_time":"2022-02-22T05:52:13.290162","status":"completed"},"tags":[]},"outputs":[],"source":["df_bike <- subset(df_bike, traveltime_SECS >= 300 & traveldist_METER >= 100 & traveltime_SECS <= 28800 & traveldist_METER <= 15000)"]},{"cell_type":"markdown","id":"fbdba3ae","metadata":{"papermill":{"duration":0.142056,"end_time":"2022-02-22T05:52:17.036114","exception":false,"start_time":"2022-02-22T05:52:16.894058","status":"completed"},"tags":[]},"source":["Original data also contains rows that mention bicycles brought into / leaving repair bays, we will exclude these from our analysis."]},{"cell_type":"code","execution_count":6,"id":"92e53b9c","metadata":{"execution":{"iopub.execute_input":"2022-02-22T05:52:17.326409Z","iopub.status.busy":"2022-02-22T05:52:17.324296Z","iopub.status.idle":"2022-02-22T05:52:32.11228Z","shell.execute_reply":"2