g0x9z4Qb4KAAAAAElFTkSuQmCC"},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["# Which month do customer in general prefer to ride in.\n","ggplot(data = df_bike) + geom_freqpoly(mapping = aes(x = month, group = member_casual, color = member_casual), stat = \"count\") + geom_point(data = df_bike, mapping = aes(x = month, color = member_casual, shape = member_casual), stat=\"count\") + labs(title = \"Monthly Trend\")\n","print(\"===== Monthly Trend =====\")\n","print(df_bike %>% group_by(member_casual, month) %>% summarise(counts = n()))\n","\n","# Which day does customer prefer to ride in.\n","ggplot(data = df_bike) + geom_freqpoly(mapping = aes(x = dayofweek, group = member_casual, color = member_casual), stat=\"count\") + geom_point(data = df_bike, mapping = aes(x = dayofweek, color = member_casual, shape = member_casual), stat=\"count\") + labs(x = \"Day\", title = \"Daily Trend\")\n","print(\"===== Daily Trend =====\")\n","print(df_bike %>% group_by(member_casual, dayofweek) %>% summarise(counts = n()))"]},{"cell_type":"markdown","id":"a0800039","metadata":{"papermill":{"duration":0.173678,"end_time":"2022-02-22T05:53:01.080852","exception":false,"start_time":"2022-02-22T05:53:00.907174","status":"completed"},"tags":[]},"source":["**Monthly**\n","\n","The data shows an interesting cycle of trend, with June to September having the most concurent user from both member & casual. November up to February see a sharp drop, rising back up at March.\n","\n","I can only assume the trend is related to the weather and outside temperature since biking is to some extent a physically taxing activity. Not only is it more pleasant to bike on warm weather, but biking under less than ideal weather condition can be troublesome and dangerous - thus customers avoid biking on colder seasons.\n","\n","**Daily**\n","\n","The daily habit of the customer seems to show a more profound insight regarding the difference in each customer type.\n","Members is much more stable across the week compared to casuals. With max point on Wednesday, and min point on Sunday.\n","It could indicate that Members use Cyclistic's service as a means of public/home-work transport.\n","\n","Casual customers are almost nonexistant all from Monday to Thursday, but then we can see a sharp increase in Friday and Saturday, which indicate that casual customers use the service out of recreational purposes since Friday and Saturday are where people usually have their time off.\n","\n","Both customer types show a slight decrease on Sunday, assuming that while Friday and Saturday are used for recreational activites, customers might take Sunday as a day to physically rest. "]},{"cell_type":"markdown","id":"c6c52f10","metadata":{"papermill":{"duration":0.169969,"end_time":"2022-02-22T05:53:01.422492","exception":false,"start_time":"2022-02-22T05:53:01.252523","status":"completed"},"tags":[]},"source":["#### Daily Bike Trends & Customer Preference\n","Out of curiosity, we could also look at how different bikes are used through out the week by the 2 customer types."]},{"cell_type":"code","execution_count":10,"id":"6beffbc6","metadata":{"execution":{"iopub.execute_input":"2022-02-22T05:53:01.791015Z","iopub.status.busy":"2022-02-22T05:53:01.788758Z","iopub.status.idle":"2022-02-22T05:53:05.833754Z","shell.execute_reply":"2022-02-22T05:53:05.832007Z"},"papermill":{"duration":4.231204,"end_time":"2022-02-22T05:53:05.833933","exception":false,"start_time":"2022-02-22T05:53:01.602729","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Warning message:\n","“Ignoring unknown parameters: binwidth, bins, pad”\n","`summarise()` has grouped output by 'dayofweek'. You can override using the `.groups` argument.\n","\n"]},{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A grouped_df: 14 × 3</caption>\n","<thead>\n","\t<tr><th scope=col>dayofweek</th><th scope=col>member_casual</th><th scope=col>count<