)) + labs(title = \"Daily Bike Trends & Customer Preference\")\n","dockedb %>% group_by(dayofweek, member_casual) %>% summarise(count = n())"]},{"cell_type":"markdown","id":"df39cb8e","metadata":{"papermill":{"duration":0.190491,"end_time":"2022-02-22T05:53:14.207362","exception":false,"start_time":"2022-02-22T05:53:14.016871","status":"completed"},"tags":[]},"source":["The chart above is a combination of both previously seen Bike Preference trends and Daily Habits: Classic Bikes being the most popular, Electric Bike Second, and Docked Bike last. Interesting to note that since the chart is a blend between Bike Preference and Daily Habits, the values are a combination of the two.\n","\n","For example, looking at the columns representing the Classic Bike from Monday to Friday, it is used mostly by Members until Saturday and Sunday comes - which then Casual customers spiked up. The same with Electric Bikes across the week."]},{"cell_type":"markdown","id":"3e23c6bd","metadata":{"papermill":{"duration":0.184926,"end_time":"2022-02-22T05:53:14.573661","exception":false,"start_time":"2022-02-22T05:53:14.388735","status":"completed"},"tags":[]},"source":["#### 5 Most Popular Start & End Station\n","The following code shows the 5 most popular station and how many times customers visit them in the year 2021.\n","Note: I opt in to display 6 most popular stop instead of 5, due to the fact that many users start and stop at random places instead of the predetermined docking stations, thus a blank \"\" with huge number below."]},{"cell_type":"code","execution_count":13,"id":"a8b4e7f2","metadata":{"execution":{"iopub.execute_input":"2022-02-22T05:53:14.94954Z","iopub.status.busy":"2022-02-22T05:53:14.947811Z","iopub.status.idle":"2022-02-22T05:53:16.006307Z","shell.execute_reply":"2022-02-22T05:53:16.004667Z"},"papermill":{"duration":1.245443,"end_time":"2022-02-22T05:53:16.006472","exception":false,"start_time":"2022-02-22T05:53:14.761029","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["[1] \"===== 5 Most Popular Starting Station =====\"\n"]},{"data":{"text/plain":["\n","                        Streeter Dr & Grand Ave   Wells St & Concord Ln \n","                 475850                   65360                   36285 \n","  Michigan Ave & Oak St       Clark St & Elm St         Millennium Park \n","                  34880                   34198                   32835 "]},"metadata":{},"output_type":"display_data"},{"name":"stdout","output_type":"stream","text":["[1] \"===== 5 Most Popular Ending Station =====\"\n"]},{"data":{"text/plain":["\n","                        Streeter Dr & Grand Ave   Michigan Ave & Oak St \n","                 505636                   62327                   36186 \n","  Wells St & Concord Ln       Clark St & Elm St         Millennium Park \n","                  34227                   32859                   32114 "]},"metadata":{},"output_type":"display_data"}],"source":["print(\"===== 5 Most Popular Starting Station =====\")\n","sort(table(as.factor(df_bike$start_station_name)),decreasing=TRUE)[1:6]\n","print(\"===== 5 Most Popular Ending Station =====\")\n","sort(table(as.factor(df_bike$end_station_name)),decreasing=TRUE)[1:6]"]},{"cell_type":"markdown","id":"ffa3d71b","metadata":{"papermill":{"duration":0.190615,"end_time":"2022-02-22T05:53:16.393437","exception":false,"start_time":"2022-02-22T05:53:16.202822","status":"completed"},"tags":[]},"source":["**The top 5 most popular starting station are at**:\n","+ **Streeter Dr & Grand Ave** - A quick google map search shows that its located at the edge of Chicago Pier, Children Museum, and Centennial Wheel. Definitely a tourism spot.\n","\n","+ **Wells St & Concord Ln** - A commercial cluster with various shops near Lincoln Park: \"Expansive outdoor urban refuge containing its own zoo, conservatory, theater, museums & playgrounds.\"\n","\n","+ **Michigan Ave & Oak St** - Another commercial cluster near Museum of Contemporary Art.\n","\n","+ **Clark St & Elm St** - Yet another commercial cluster. Located between Wells St & Concord Ln on its northwest and Michigan Ave & Oak St on its southeast. The three location becomes an interconnected shopping center.\n","\n","+ **Millennium Park** - A big park, located side by side with Chicago Central. This stop seems to cater both tourist and business goers since commercial buildings sits next to recreational spot, and next to Art Institiute of Chicago."]},{"cell_type":"markdown","id":"26327b85","metadata":{"papermill":{"duration":0.187607,"end_time":"2022-02-22T05:53:16.769921","exception":false,"start_time":"2022-02-22T05:53:16.582314","status":"completed"},"tags":[]},"source":["#### Travel Time & Distance Distirbution\n","Previously in data cleaning, we omit certain observations with extreme values, those with travel time and distance of negative or positives with unrealistic values. We shall now see the density curves of these 2 variables."]},{"cell_type":"code","execution_count":14,"id":"b650fc23","metadata":{"execution":{"iopub.execute_input":"2022-02-22T05:53:17.160391Z","iopub.status.busy":"2022-02-22T05:53:17.158553Z","iopub.status.idle":"2022-02-22T05:56:52.070036Z","shell.execute_reply":"2022-02-22T05:56:52.06897Z"},"papermill":{"duration":215.105431,"end_time":"2022-02-22T05:56:52.070328","exception":false,"start_time":"2022-02-22T05:53:16.964897","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Warning message:\n","“Removed 37194 rows containing non-finite values (stat_bin).”\n","Warning message:\n","“Removed 39481 rows containing non-finite values (stat_bin).”\n"]},{"name":"stdout","output_type":"stream","text":["[1] \"Population Travel Distance Mean, Median (Meters):\"\n","[1] 2614.556 2033.040\n","[1] \"Population Travel Time Mean, Median (Seconds):\"\n","[1] 1188.403  816.000\n","[1] \"Population Travel Time Mean, Median (Minutes):\"\n","[1] 19.80672 13.60000\n"]},{"data":{"image/