markdown","id":"0829fe37","metadata":{"papermill":{"duration":0.21371,"end_time":"2022-02-22T05:56:52.494008","exception":false,"start_time":"2022-02-22T05:56:52.280298","status":"completed"},"tags":[]},"source":["As we can see above, the data is very skewed, it makes it hard for us to see where the majority in which the data lies. We will transform the data using natural logarithm.\n","\n","You might see a warning message saying about 35+ thousand observations removed. Worry not, those are not removed from the actual data, it just wasn't shown in the chart due to it being on the extreme end of the distribution.\n","This is due to previously including data with observations of travel distance up to 15Km and time of up to 8 Hours."]},{"cell_type":"code","execution_count":15,"id":"24c8d32b","metadata":{"execution":{"iopub.execute_input":"2022-02-22T05:56:52.91355Z","iopub.status.busy":"2022-02-22T05:56:52.912033Z","iopub.status.idle":"2022-02-22T05:56:54.606851Z","shell.execute_reply":"2022-02-22T05:56:54.605554Z"},"papermill":{"duration":1.905727,"end_time":"2022-02-22T05:56:54.607001","exception":false,"start_time":"2022-02-22T05:56:52.701274","status":"completed"},"tags":[]},"outputs":[],"source":["# Making a new data set with logarithmic transform of travel distance and time.\n","logbike <- df_bike %>% within({\n","  traveldist_METER <- log(df_bike$traveldist_METER, exp(1))\n","  traveltime_SECS <- log(df_bike$traveltime_SECS, exp(1))\n","}) %>% subset(select = c(traveltime_SECS, traveldist_METER, member_casual, rideable_type))\n","\n","logmem <- subset(logbike, member_casual == \"member\")\n","\n","logcas <- subset(logbike, member_casual == \"casual\")"]},{"cell_type":"markdown","id":"8a512898","metadata":{"papermill":{"duration":0.204159,"end_time":"2022-02-22T05:56:55.013524","exception":false,"start_time":"2022-02-22T05:56:54.809365","status":"completed"},"tags":[]},"source":["#### Transformed Travel Distance\n"]},{"cell_type":"code","execution_count":16,"id":