ean, Median (Meters):\")\n","print(c((exp(1)^mean(logmem$traveldist_METER)), (exp(1)^median(logmem$traveldist_METER))))\n","print(\"Casual Travel Distance Mean, Median (Meters):\")\n","print(c((exp(1)^mean(logcas$traveldist_METER)), (exp(1)^median(logcas$traveldist_METER))))"]},{"cell_type":"markdown","id":"26ce46b7","metadata":{"papermill":{"duration":0.220466,"end_time":"2022-02-22T06:00:11.808886","exception":false,"start_time":"2022-02-22T06:00:11.58842","status":"completed"},"tags":[]},"source":["After being transformed, the travel distance has taken a vaguely normal distribution, thus we can use the function qnorm() to estimate roughly what is the 5th and 95th quantile to see the range of distance in which 90% of customer travels."]},{"cell_type":"code","execution_count":17,"id":"56911439","metadata":{"execution":{"iopub.execute_input":"2022-02-22T06:00:12.245299Z","iopub.status.busy":"2022-02-22T06:00:12.243731Z","iopub.status.idle":"2022-02-22T06:00:12.553739Z","shell.execute_reply":"2022-02-22T06:00:12.552511Z"},"papermill":{"duration":0.527756,"end_time":"2022-02-22T06:00:12.553971","exception":false,"start_time":"2022-02-22T06:00:12.026215","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["[1] \"===== Travel Distance Member =====\"\n","[1] \"5th percentile of member's travel distance: 702.19 Meters\"\n","[1] \"95th percentile of member's travel distance: 6194.97 Meters\"\n","[1] \"\"\n","[1] \"Member Travel Distance Mean, Median (Meters):\"\n","[1] 2085.68 2006.39\n","[1] \"\"\n","[1] \"===== Travel Distance Casual =====\"\n","[1] \"5th percentile of casual's travel distance: 640.58 Meters\"\n","[1] \"95th percentile of casual's travel distance: 6684.26 Meters\"\n","[1] \"\"\n","[1] \"Casual Travel Distance Mean, Median (Meters):\"\n","[1] 2069.257 2069.820\n"]}],"source":["# travel distance 5th and 95th quantile distance\n","memtdlow <- exp(1)^(qnorm(0.05, mean(logmem$traveldist_METER), sd(logmem$traveldist_METER)))\n","memtdlow <- as.character(format((round(memtdlow, 2))))\n","memtdupr <- exp(1)^(qnorm(0.95, mean(logmem$traveldist_METER), sd(logmem$traveldist_METER)))\n","memtdupr <- as.character(format((round(memtdupr, 2))))\n","\n","castdlow <- exp(1)^(qnorm(0.05, mean(logcas$traveldist_METER), sd(logcas$traveldist_METER)))\n","castdlow <- as.character(format((round(castdlow, 2))))\n","castdupr <- exp(1)^(qnorm(0.95, mean(logcas$traveldist_METER), sd(logcas$traveldist_METER)))\n","castdupr <- as.character(format((round(castdupr, 2))))\n","\n","print(\"===== Travel Distance Member =====\")\n","print(paste0(\"5th percentile of member's travel distance: \", memtdlow,\" Meters\"))\n","print(paste0(\"95th percentile of member's travel distance: \", memtdupr,\" Meters\"))\n","print(\"\")\n","print(\"Member Travel Distance Mean, Median (Meters):\")\n","print(c(exp(1)^(mean(logmem$traveldist_METER)), (exp(1)^median(logmem$traveldist_METER))))\n","print(\"\")\n","print(\"===== Travel Distance Casual =====\")\n","print(paste0(\"5th percentile of casual's travel distance: \", castdlow,\" Meters\"))\n","print(paste0(\"95th percentile of casual's travel distance: \", castdupr,\" Meters\"))\n","print(\"\")\n","print(\"Casual Travel Distance Mean, Median (Meters):\")\n","print(c((exp(1)^mean(logcas$traveldist_METER)), (exp(1)^median(logcas$traveldist_METER))))"]},{"cell_type":"markdown","id":"1968d195","metadata":{"papermill":{"duration":0.240865,"end_time":"2022-02-22T06:00:13.027736","exception":false,"start_time":"2022-02-22T06:00:12.786871","status":"completed"},"tags":[]},"source":["As shown in the result above, the function qnorm() tells us that 90% of Members travel somewhere between 700m to 6.2Km, while Casual travels slightly shorter and further 630m to 6.6Km. Also, in the previous chart, the mean and median of the 2 customer demographic, they seem to be quite similar, hovering about 2km."]},{"cell_type":"markdown","id":"1bbaa555","metadata":{"papermill":{"duration":0.229455,