= \"Distribution Type: Gamma \\nStraight line: mean \\nDashed line: meadian\")\n","\n","ttmem <- ggplot(data = logmem, aes(traveltime_SECS)) + geom_freqpoly(binwidth = 0.05) + geom_vline(aes(xintercept = mean(traveltime_SECS))) + geom_vline(linetype = 2, aes(xintercept = median(traveltime_SECS))) + labs(x = \"Travel time in seconds (Natural Log)\", title = \"Member Travel Time\")\n","\n","ttcas <- ggplot(data = logcas, aes(traveltime_SECS)) + geom_freqpoly(binwidth = 0.05) + geom_vline(aes(xintercept = mean(traveltime_SECS))) + geom_vline(linetype = 2, aes(xintercept = median(traveltime_SECS))) + labs(x = \"Travel time in seconds (Natural Log)\", title = \"Casual Travel Time\")\n","\n","grid.arrange(ttpop, arrangeGrob(ttmem,ttcas,ncol=2))\n","\n","print(\"Member Travel Distance Mean, Median (Minutes):\")\n","print(c((exp(1)^mean(logmem$traveltime_SECS))/60, (exp(1)^median(logmem$traveltime_SECS))/60))\n","print(\"Casual Travel Distance Mean, Median (Minutes):\")\n","print(c((exp(1)^mean(logcas$traveltime_SECS))/60, (exp(1)^median(logcas$traveltime_SECS))/60))\n"]},{"cell_type":"markdown","id":"71d33821","metadata":{"papermill":{"duration":0.247426,"end_time":"2022-02-22T06:03:32.019494","exception":false,"start_time":"2022-02-22T06:03:31.772068","status":"completed"},"tags":[]},"source":["After being transformed the travel time takes a gamma distribution. In order to guess the 5th and 95th quantile, we would need to use qgamma() function, along with calculating the shape, rate, and scale of the distribution. A user by the name \"Henry\" in Math Stack Exchange provides us with a helpful summary in calculating shape, rate, and scale. \n","\n","Source can be found here: [Math Stack Exchange](https://math.stackexchange.com/questions/2873763/is-it-possible-to-determine-shape-and-scale-for-a-gamma-distribution-from-a-mean)"]},{"cell_type":"code","execution_count":19,"id":"ee85e3ad","metadata":{"execution":{"iopub.execute_input":"2022-02-22T06:03:32.516845Z","iopub.status.busy":"2022-02-22T06:03:32.514371Z","iopub.status.idle":"2022-02-22T06:03:32.869229Z","shell.execute_reply":"2022-02-22T06:03:32.867701Z"},"papermill":{"duration":0.608254,"end_time":"2022-02-22T06:03:32.869399","exception":false,"start_time":"2022-02-22T06:03:32.261145","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["[1] \"===== Travel Time Member =====\"\n","[1] \"5th percentile of member's travel time: 4.9 Minutes\"\n","[1] \"95th percentile of member's travel time: 34 Minutes\"\n","[1] \"\"\n","[1] \"Member Travel Time Mean, Median (Minutes):\"\n","[1] 12.6 11.7\n","[1] \"\"\n","[1] \"===== Travel Time Casual =====\"\n","[1] \"5th percentile of casual's travel time: 5.5 Minutes\"\n","[1] \"95th percentile of casual's travel time: 63.7 Minutes\"\n","[1] \"\"\n","[1] \"Casual Travel Time Mean, Median (Minutes):\"\n","[1] 17.9 16.4\n"]}],"source":["# Member Gamma shape and rate\n","memgshape <- (mean(logmem$traveltime_SECS)^2)/(sd(logmem$traveltime_SECS)^2)\n","memgrate <- mean(logmem$traveltime_SECS)/(sd(logmem$traveltime_SECS)^2)\n","memttgupr <- (exp(1)^qgamma(0.95, memgshape, memgrate))/60\n","memttglow <- (exp(1)^qgamma(0.05, memgshape, memgrate))/60\n","\n","casgshape <- (mean(logcas$traveltime_SECS)^2)/(sd(logcas$traveltime_SECS)^2)\n","casgrate <- mean(logcas$traveltime_SECS)/(sd(logcas$traveltime_SECS)^2)\n","casttgupr <- (exp(1)^qgamma(0.95, casgshape, casgrate))/60\n","casttglow <- (exp(1)^qgamma(0.05, casgshape, casgrate))/60\n","\n","print(\"===== Travel Time Member =====\")\n","print(paste0(\"5th percentile of member's travel time: \", round(memttglow, 1),\" Minutes\"))\n","print(paste0(\"95th percentile of member's travel time: \", round(memttgupr, 1) ,\" Minutes\"))\n","print(\"\")\n","print(\"Member Travel Time Mean, Median (Minutes):\")\n","print(c(round(((exp(1)^(mean(logmem$traveltime_SECS)))/60), 1), round(((exp(1)^(median(logmem$traveltime_SECS)))/60), 1)))\n","print(\"\")\n","print(\"===== Travel Time Casual =====\")\n","print(paste0(\"5th percentile of casual's travel time: \", round(casttglow, 1),\" Minutes\"))\n","print(paste0(\"95th percentile of casual's travel time: \", round(casttgupr, 1),\" Minutes\"))\n","print(\"\")\n","print(\"Casual Travel Time Mean, Median (Minutes):\")\n","print(c(round(((exp(1)^(mean(logcas$traveltime_SECS)))/60), 1), round(((exp(1)^(median(logcas$traveltime_SECS)))/60), 1)))\n"]},{"cell_type":"markdown","id":"b1264302","metadata":{"papermill":{"duration":0.252133,"end_time":"2022-02-22T06:03:33.372695","exception":false,"start_time":"2022-02-22T06:03:33.120562","status":"completed"},"tags":[]},"source":["Both users 5th quantile starts at about 5 minutes, this is due to the previously omitted values in data cleaning. The 95th quantile in the other hand shows that member travels up to 30 minutes, while casuals would travel up to an hour. Recall that 95th quantile of the distance for both members and casuals stands at around 6Km. This could further support the assumption that casuals only the service for recreation, due to similar distance traveled but at a leisured pace."]},{"cell_type":"markdown","id":"ac66ebca","metadata":{"papermill":{"duration":0.25999,"end_time":"2022-02-22T06:03:33.886712","exception":false,"start_time":"2022-02-22T06:03:33.626722","status":"completed"},"tags":[]},"source":["#### Member Ratio Regression Line\n","Not directly related to the business task of finding out how the customer base differ, but its always a good idea to see if we are gaining or losing our Members. Recall that the number of customer using our service differs depending on the season of the year, thus using exact numbers are not reliable. We will instead use ratio, Member/Total Customer of Current Month."]},{"cell_type":"code","execution_count":20,"id":"88762fee","metadata":{"execution":{"iopub.execute_input":"2022-02-22T06:03:34.411845Z","iopub.status.busy":"2022-02-22T06:03:34.409268Z","iopub.status.idle":"2022-02-22T06:03:37.370064Z