tercept = coef(lm(regmonth$ratio ~ regmonth$monthnum))[[1]], slope = coef(lm(regmonth$ratio ~ regmonth$monthnum))[[2]]) + labs(y = \"Member in current mnth / total obs of current mnth (Ratio)\", title = \"Best fit line of member/total observation per month\", subtitle = \"Line: Y = 0.67490965 - 0.01215783*X \\nStandard Error Estimate: (Red Line): 0.1213464\") + geom_abline(intercept = coef(lm(regmonth$ratio ~ regmonth$monthnum))[[1]] + sigma(linearrm), slope = coef(lm(regmonth$ratio ~ regmonth$monthnum))[[2]], color = \"red\") + geom_abline(intercept = coef(lm(regmonth$ratio ~ regmonth$monthnum))[[1]] - sigma(linearrm), slope = coef(lm(regmonth$ratio ~ regmonth$monthnum))[[2]], color = \"red\")"]},{"cell_type":"markdown","id":"8d003d25","metadata":{"papermill":{"duration":0.268358,"end_time":"2022-02-22T06:03:37.937397","exception":false,"start_time":"2022-02-22T06:03:37.669039","status":"completed"},"tags":[]},"source":["The coefficient function returns to us an intercept of 0.674, slope of -0.0121, and standard error estimate of 0.12.\n","\n","From the data provided for the year 2021, it seems that *Cyclistic* is losing 1.21% of its members every month. Monthly flunctuation can be explained by the standard error estimate of +- 12% .\n","Keep in mind that they might not entirely leave the service, they may actually just converted into casual customers, its just that if we compare the amount of members using the service against the total amount of all the customers in the same month, in general there is 1.21% less member customers."]},{"cell_type":"markdown","id":"b7f6fa23","metadata":{"papermill":{"duration":0.268367,"end_time":"2022-02-22T06:03:38.479601","exception":false,"start_time":"2022-02-22T06:03:38.211234","status":"completed"},"tags":[]},"source":["# Conclusion\n","From the analysis above, we understand the following insights regarding the data:\n","\n","### General population & similarities\n","Starting with information regarding the general population, the ratio of member vs casual customer are very similar, 47.11% - 52.88% divide as of the year 2021. \n","\n","#### Bike Preference\n","Classic Bike is the most popular variation, with Electric Bikes coming second and Docked Bikes last.\n","That summer and early autumn is the preferred seasons for bike ride, with a sharp decline in colder months, makes sense assuming that bike trips are more pleasant on hotter weather than colder ones.\n","\n","#### Popular Stations\n","All the favourite station, Streeter Dr & Grand Ave, Wells St & Concord Ln, Michigan Ave & Oak St, Clark St & Elm St, and Millennium Park are located in the general vicinity of northeastern side of Chicago, the side that closest to the shore facing Lake Michigan. The common feature of the 5 stations are that they are close to either commercial clusters, tourism spot, and significant buildings like university, museums, and business centers.\n","\n","### Difference Between the Customer Base\n","As how the two population differs in how they use the service, we can look at the day to day usage within a week and the location that each section of the customer base starts and arrives at.\n","\n","#### Day to Day Use\n","Members regularly uses the bike in their day to day transport, with the numbers staying steady across the weekdays and weekend, but casual seems to use the bike for recreational purposes as their numbers surged at the weekend.\n","\n","Also good to know that number of members using the rent service takes a small dip on Thursday and Friday, before picking up on Saturday and dropping back down on sunday. Assumptions being that since members regularly uses the bike service, it can be a good picture on the energy levels on members as people get tired from work on Thursday and Friday, taking Saturday as a recreation day, and Sunday as a day to physically rest.\n","\n","Casual mostly stay low on monday to thursday, and having a huge increase in Friday and subsequently Saturday, but also suffers from the same dip on sunday as members do.\n","\n","In general (90% of the customer base), people traveled between X to X, which takes anywhere from X to X.\n","\n","#### Arrival & Departure Locations\n","We can also map the geogrpahic coordinates to Tableau Public, you can find the image in the following link: [Tableau Public](https://public.tableau.com/views/DivvyStartEndcoordinates/StartCoordinates?:language=en-US&:display_count=n&:origin=viz_share_link)\n","\n","From the images on imported from tableau, we can see that member users are densely packed within the downtown Chicago, with casual members more interspersed across suburban area. This assumption can be further supported by looking at the travel time and distance distribution graph, members tend to take shorter trips in comparison to casuals, despite the two customer base being nearly equal.\n","\n","### Additional Information\n","**Regarding Bike Types**\n","You may have notice in the charts showing customer's bike type preference, monthly use, and day to day use. Docked Bikes is are exclusively used by casual customers.\n","\n","**Member Monthly Ratio**\n","Each month, the amount of members using the service decreases by 1.2%.\n","But it should be kept in mind that the data is only for 2021, where the last 2 years COVID has forced people to stay at home, thus this number is not representative of the actual financial health of the business.\n","If anything, it might actually good to hear that despite the pandemic, the business is doing well in customer retention."]},{"cell_type":"markdown","id":"357771a4","metadata":{"papermill":{"duration":0.277746,"end_time":"2022-02-22T06:03:39.022636","exception":false,"start_time":"2022-02-22T06:03:38.74489","status":"completed"},"tags":[]},"source":["# Appendix\n","## Reference & Sources\n","### R Programming & Syntax\n","\n","+ Tutorialspoint.com. (2019). Tutorialspoint.com.[online] Available at: https://www.tutorialspoint.com/index.htm.\n","+ www.w3schools.com. (n.d